const stats = [
  { number: "10K+", label: "Journals Written" },
  { number: "5K+", label: "Happy Users" },
  { number: "99.9%", label: "Data Privacy" },
];

const WebStats = () => {
  return (
    <div className="flex items-center justify-center py-16 bg-pink-50 font-figtree">
      <div className="bg-white bg-opacity-90 rounded-3xl shadow-xl p-10 max-w-2xl w-full">
        <h2 className="text-4xl text-center text-pink-500 mb-4 font-sacramento">
          ðŸ“Š Our Impact
        </h2>
        <p className="text-center text-gray-600 mb-8 font-raleway">
          Helping thousands reflect, grow and find emotional clarity every day.
        </p>

        <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-6">
          {stats.map((stat, idx) => (
            <div
              key={idx}
              className="bg-pink-100 rounded-lg p-4 text-center shadow hover:shadow-md transition"
            >
              <div className="text-2xl text-pink-600 font-bold">{stat.number}</div>
              <div className="text-sm text-gray-600">{stat.label}</div>
            </div>
          ))}
        </div>

        <div className="mt-8 text-center">
          <a
            href="/next"
            className="inline-block px-6 py-3 rounded-full bg-pink-500 text-white font-semibold hover:bg-pink-600 transition"
          >
            Get Started Now
          </a>
        </div>
      </div>
    </div>
  );
};

export default WebStats;
